import React from 'react';
import './Header.css';
import Logo from './Logo';
import NavBar from './NavBar';

function Header() {
  return (
    <header className="header">
      <div className="header-content">
        <Logo />
        <NavBar />
      </div>
    </header>
  );
}

export default Header;
